import redux from 'redux';
import gestionModal from './gestion.modal';
import marcheModal from './marche.modal';
import plusLoinModal from './plusLoin.modal';
import profilModal from './profil.modal';
import reglesModal from './regles.modal';
import supportModal from './support.modal';

const index = ({
    gestionModal,
    marcheModal,
    plusLoinModal,
    profilModal,
    reglesModal,
    supportModal
});

export default index
